8,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u305f\u30d5\u30a1\u30a4\u30eb\u3092\u4eee\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u306b\u4e00\u6642\u4fdd\u5b58\u3059\u308b\u5b9f\u88c5\u4f8b\u3092\u793a\u3059":28,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u305f\u30d5\u30a1\u30a4\u30eb\u3092\u53d6\u5f97\u3059\u308b\u65b9\u6cd5\u306f\u5927\u304d\u304f\uff12\u3064\u3042\u308b":42,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u305f\u30d5\u30a1\u30a4\u30eb\u3092\u64cd\u4f5c\u3059\u308b\u305f\u3081\u306e\u30e1\u30bd\u30c3\u30c9\u304c\u7528\u610f\u3055\u308c\u3066\u3044\u308b":28,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u305f\u5404\u30d5\u30a1\u30a4\u30eb\u306e\u30d5\u30a1\u30a4\u30eb\u540d\u306b\u3064\u3044\u3066":64,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u306a\u3044\u3088\u3046\u306b\u3059\u308b":28,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u308b\u30d5\u30a1\u30a4\u30eb\u306e\u30d5\u30a1\u30a4\u30eb\u540d\u304c\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u3067\u8a31\u53ef\u3055\u308c\u305f\u30d1\u30bf\u30fc\u30f3\u3068\u4e00\u81f4\u3059\u308b\u304b\u3092\u30c1\u30a7\u30c3\u30af\u3059\u308b":64,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u308b\u30d5\u30a1\u30a4\u30eb\u306e\u30d5\u30a1\u30a4\u30eb\u540d\u304c\u8a31\u5bb9\u3055\u308c\u3066\u3044\u308b\u30d1\u30bf\u30fc\u30f3\u3068\u4e00\u81f4\u3059\u308b\u3053\u3068\u3092\u691c\u8a3c\u3059\u308b\u30a2\u30ce\u30c6\u30fc\u30b7\u30e7\u30f3":64,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u308b\u30d5\u30a1\u30a4\u30eb\u306e\u62e1\u5f35\u5b50\u304c\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u3067\u8a31\u53ef\u3055\u308c\u305f\u3082\u306e\u3067\u3042\u308b\u304b\u3092\u30c1\u30a7\u30c3\u30af\u3059\u308b":64,"\u30a2\u30c3\u30d7\u30ed\u30fc\u30c9\u3055\u308c\u308b\u30d5\u30a1\u30a4\u30eb\u306e\u62e1\u5f35\u5b50\u304c\u8a31\u5bb9\u3055\u308c\u3066\u3044\u308b\u3082\u306e\u3067\u3042\u308b\u3053\u3068\u3092\u691c\u8a3c\u3059\u308b\u30a2\u30ce\u30c6\u30fc\u30b7\u30e7\u30f3":64,